import React, { useState } from 'react';

const AIFinancialAnalysis = ({ expenses = [], savings = [] }) => {
  const [aiInsights, setAiInsights] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchAIAnalysis = async () => {
    setIsLoading(true);
    setError(null);

    try {
      // Calcular análisis directamente sin usar el modelo
      const totalExpenses = expenses.reduce((sum, exp) => sum + parseFloat(exp.amount || 0), 0);
      const totalSavings = savings.reduce((sum, sav) => sum + parseFloat(sav.current_amount || 0), 0);

      // Agrupar gastos por categoría
      const expensesByCategory = expenses.reduce((acc, exp) => {
        const category = exp.category || 'Otros';
        acc[category] = (acc[category] || 0) + parseFloat(exp.amount || 0);
        return acc;
      }, {});

      // Ordenar categorías por monto
      const sortedCategories = Object.entries(expensesByCategory)
        .sort(([, a], [, b]) => b - a)
        .map(([category]) => category);

      // Calcular potencial de ahorro (20% de gastos)
      const potentialSavings = totalExpenses * 0.2;

      // Generar recomendaciones basadas en datos reales
      const recommendations = [
        `Considera reducir gastos en ${sortedCategories[0]}, que es tu mayor categoría de gasto`,
        `Podrías ahorrar hasta ${potentialSavings.toFixed(2)}€ mensuales con pequeños ajustes`,
        'Establece un presupuesto mensual para cada categoría de gasto'
      ];

      const analysisResult = {
        gastosTotales: totalExpenses,
        ahorrosTotales: totalSavings,
        analisisGastos: `Tus mayores gastos están en ${sortedCategories.slice(0, 3).join(', ')}`,
        progresoAhorros: `Has acumulado ${totalSavings.toFixed(2)}€ en ahorros`,
        recomendaciones: recommendations,
        categoriasMayorGasto: sortedCategories.slice(0, 3),
        potencialAhorro: potentialSavings
      };

      setAiInsights(analysisResult);
    } catch (error) {
      console.error('Error:', error);
      setError('Error al procesar el análisis');
    }

    setIsLoading(false);
  };

  return (
    <div className="p-4 space-y-4">
      <button
        onClick={fetchAIAnalysis}
        disabled={isLoading}
        className={isLoading ? 
          "w-full py-2 px-4 rounded-lg text-white bg-gray-400" : 
          "w-full py-2 px-4 rounded-lg text-white bg-blue-600 hover:bg-blue-700"}
      >
        {isLoading ? "Analizando..." : "Obtener Análisis"}
      </button>

      {error && (
        <div className="p-3 bg-red-50 border border-red-200 rounded-lg text-red-700">
          {error}
        </div>
      )}

      {aiInsights && (
        <div className="space-y-4">
          <div className="grid grid-cols-2 gap-4">
            <div className="p-3 bg-blue-50 rounded-lg">
              <p className="text-sm text-blue-600">Gastos Totales</p>
              <p className="text-xl font-bold">
                {aiInsights.gastosTotales.toLocaleString('es-ES', {
                  style: 'currency',
                  currency: 'EUR'
                })}
              </p>
            </div>
            <div className="p-3 bg-green-50 rounded-lg">
              <p className="text-sm text-green-600">Ahorros Totales</p>
              <p className="text-xl font-bold">
                {aiInsights.ahorrosTotales.toLocaleString('es-ES', {
                  style: 'currency',
                  currency: 'EUR'
                })}
              </p>
            </div>
          </div>

          <div className="space-y-3">
            <div>
              <h3 className="font-medium">Análisis de Gastos</h3>
              <p className="text-gray-700">{aiInsights.analisisGastos}</p>
            </div>

            <div>
              <h3 className="font-medium">Progreso de Ahorros</h3>
              <p className="text-gray-700">{aiInsights.progresoAhorros}</p>
            </div>

            <div>
              <h3 className="font-medium">Categorías con Mayor Gasto</h3>
              <div className="flex gap-2 flex-wrap">
                {aiInsights.categoriasMayorGasto.map((cat, index) => (
                  <span key={index} className="px-2 py-1 bg-gray-100 rounded-full text-sm text-gray-700">
                    {cat}
                  </span>
                ))}
              </div>
            </div>

            <div>
              <h3 className="font-medium">Recomendaciones</h3>
              <ul className="list-disc list-inside">
                {aiInsights.recomendaciones.map((rec, index) => (
                  <li key={index} className="text-gray-700">{rec}</li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AIFinancialAnalysis;
